create table employee
(
    id            int auto_increment comment '表记录ID'
        primary key,
    version       int          not null comment '版本号',
    create_time   datetime     not null comment '创建时间',
    update_time   datetime     not null comment '更新时间',
    is_deleted    int          not null comment '逻辑删除（0：未删除；1：已删除）',
    avatar        varchar(255) null,
    name          varchar(255) not null comment '姓名',
    username      varchar(255) not null comment '账户',
    password      varchar(255) null comment '经过盐加密的密码',
    salt          varchar(255) null comment '盐',
    email         varchar(255) null comment '邮箱',
    phone         varchar(255) null comment '电话',
    sex           int          null comment '性别',
    department_id int          null comment '部门ID',
    post_id       int          null comment '岗位ID',
    role_id       int          null comment '角色ID',
    constraint employee_username_uindex
        unique (username)
);

